  [],\n\t\"revision_timestamp\": \"2015-05-06T21:55:12.280441\",\n\t\"name\": \"high-transparent-metal-oxide-polyimide-antistatic-coatings-project-2baf9\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Through this Phase I program, Agiltron has
  successfully produced an innovative transparent conductive nanocomposite paint that
  holds the promise of meeting space application requirements.   The paint can be
  easily applied to many surfaces and forms a clear conductive coating at temperatures
  as low as 130 &lt;SUP&gt;o&lt;/SUP&gt;C.    These coatings exhibit high visible
  transparency of ~ 85 &#37; (&gt; 95&#37; with additional AR coating) and good conductive
  sheet resistance in the range of 106  to 108 ohm/sq.  Agiltron has also performed
  harsh environmental testing in which the coatings show no degradation after undergoing
  UV radiation up to 32 J/cm2 irradiation, low temperature cycling down to 77 oK,
  high vacuum pumping, and collision with fragmented debris. The proposed robust clear
  conductive coating is therefore well suited for NASA space environment resistant
  polymer coating related applications.  The high performance paint will also find
  wide commercial applications, such as in flexible displays.  In Phase II, we will
  continue these efforts through a concentration on optimization and scale-up of stable
  ITO/polymer suspensions and the development of low-cost, large-scale deposition
  and patterning processes for the practical applications of this new class of transparent
  conductive coatings.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
